import "./Featured.css";

const FeaturedMainPage = () => {
    return(
        <article className="Featuredmainpage">
            <header className="Featuredmainpage__header">
                <h3 className="Featuredmainpage__header__title">
                    Features
                </h3>
            </header>
            <section></section>
        </article>
    )
}
 export default FeaturedMainPage;
